import Carousel from 'react-bootstrap/Carousel';
import Card from 'react-bootstrap/Card';

function Posts(post) {
  return (
    <Carousel style={{padding:"20px"}}slide={false} variant="dark" autoPlay={false} arrows={true}>
        {post.map(p=>
            <Carousel.Item>
            <Card>
              <Card.Body>
                <Card.Title>{p.title}</Card.Title>
                <Card.Text>
                  {p.s}
                </Card.Text>
              </Card.Body>
              <Card.Footer>
                <small className="text-muted" style={{alignItems:"right"}}>
                <ul class="bottm">
                  <li>Type: </li>
                  <li>By: </li>
              </ul>
                </small>
              </Card.Footer>
              </Card>
            </Carousel.Item>
        )}

    </Carousel>
  );
}

export default Posts;
